import React, { Component } from 'react';

class Hello extends Component {
    render() {
        return (
            <div>
                <h1 className="tc"> Hello world</h1>
                <p class="fw6">Welcome to React</p>
                <p>This is going to be awesome</p>
                <h3>YAY, look at that!</h3>
            </div>
        );
    }
}

export default Hello;
